Release Information

Taking its inspiration from ancient Chinese tales of revenge and
retribution and then adding a dash of over-the-top martial arts and old
school arcade fun, Kung Fu Strike features 28 stages of fast-paced
combo-based fighting. Blend powerful punches, high kicks and perfectly
timed blocks to pull off devastating combos, all thanks to a fluid
combat system that turns brawling into an art form

Features

Old-school beat-em-up arcade appeal

Unlock items and abilities to further customize style of play

Online leaderboards breed competition between players

Later levels will challenge your Kung Fu on even the lowest difficulty
setting

Freely flowing combat mechanics allow jaw-dropping combos

Fight with or against a friend in local co-op

